import React from "react";

function CaseStudies() {
  return (
    <div>
      <h3>Word of mouth</h3>
      <div className="case-study">
        <h4>Callcredit UK</h4>
        <p>
          Words can't explain how I feel about you guys. You have personally
          supported me through a few tough months and you are always there to
          guide and instruct when I don't know the way forward or the right
          answers.
        </p>
      </div>
      <button>OUR CASE STUDIES</button>
    </div>
  );
}

export default CaseStudies;
